package passage1;

public class Solution {
    public static String originalDigits(String s) {
        StringBuffer result = new StringBuffer();
        StringBuffer nunstr = new StringBuffer("zerontwhfuivsxg");
        StringBuffer sb = new StringBuffer(s);

        int[] numInt = new int[26];
        int sbLength = sb.length();

        for (int i = 0; i < sbLength; i++) {
            char c = sb.charAt(i);
            numInt[c-'a']+=1;
        }

        int[] num = new int[10];
        num[0] = numInt['z'-'a'];
        num[2] = numInt['w'-'a'];
        num[4] = numInt['u'-'a'];
        num[6] = numInt['x'-'a'];
        num[8] = numInt['g'-'a'];
        num[1] = numInt['o'-'a'] - num[2] - num[4] - num[0];
        num[3] = numInt['t'-'a'] - num[2] - num[8];
        num[5] = numInt['f'-'a'] - num[4];
        num[7] = numInt['s'-'a'] - num[6];
        num[9] = numInt['i'-'a'] - num[5] - num[6] - num[8];

        for (int i = 0; i < num.length; i++) {
            for (int j = 0; j < num[i]; j++) {
                result.append(i);
            }
        }
        return result.toString();
    }


    public static void main(String[] args) {


        String s = "";
        String a = "";
        String b = "";
//        System.out.println(Solution.originalDigits("zerozerozerozerozerotwotwotwotwotwo"));
        System.out.println(Solution.originalDigits(s).equals(b));
    }
}